import React from 'react';
import styled from 'styled-components';
import './App.css';
import ButtonShowcase from './components/Button/ButtonShowcase';
import CardShowcase from './components/Card/CardShowcase';

const AppContainer = styled.div`
  padding: 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const Header = styled.header`
  margin-bottom: 3rem;
`;

const Section = styled.section`
  margin-bottom: 4rem;
`;

function App() {
  return (
    <AppContainer>
      <Header>
        <h1>NVIDIA Component Hub</h1>
        <p>A collection of reusable components and sections for NVIDIA websites.</p>
      </Header>

      <Section>
        <ButtonShowcase />
      </Section>

      <Section>
        <CardShowcase />
      </Section>
    </AppContainer>
  );
}

export default App;
